import React from "react";
import "./navbar.css";
import navItems from "../data/navBar.json";

function Navbar() {
    return (
        <nav className="navbar">
            <div>
                <p>Booking Website</p>

            </div>
            {navItems.map((item) => (
                <div
                    key={item.type}
                    className={`nav-item ${item.active ? "active" : ""}`}
                >
                    <i className={`fa ${item.icon}`}></i>
                    <span>{item.type}</span>
                </div>
            ))}
        </nav>
    );
}

export default Navbar;
